/**
 * This file is used to declare the types for the rete-react-render-plugin.
 * So we will not get a "Could not find a declaration file for module 'rete-react-render-plugin'" error when
 * ```
 * import { Node, Socket, Control } from 'rete-react-render-plugin';
 * ```
 */
declare module 'rete-react-render-plugin';
